import { Routes, Route, Link } from 'react-router-dom';

const Home = ()=> {
  return <h1>Inicio</h1>;
}

const Contacto= ()=> {
  return <h1>Contacto</h1>;
}

function App() {
  return (
    <div>
      <nav>
        <ul>
          <li>
            <Link to="/">Inicio</Link>
          </li>
          <li>
            <Link to="/contacto">Contacto</Link>
          </li>
        </ul>
      </nav>
      <section>
        <Routes>
          <Route exact path="/" element={<h1>Inicio</h1>} />
          <Route path="/contacto" element={<h1>epa</h1>} />
        </Routes>

      </section>
    </div>
  );
}

export default App;
